original_question:
ತ್ರಿಭುಜ $ABC$ ಸಮದ್ವಿಬಾಹು, $AB=AC$ ಮತ್ತು ಎತ್ತರ $AM=11.$ $\overline{AM}$ ಮೇಲೆ $D$ ಎಂಬ ಬಿಂದು $AD=10$ ಮತ್ತು $\angle BDC=3\angle BAC$ ಇರುವಂತೆ ಇದೆ. ತ್ರಿಭುಜ $ABC$ ಯ ಪರಿಮಿತಿ ಕಂಡುಹಿಡಿಯಿರಿ.

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

